import React from 'react';
import './App.css';
import Nav from './nav.jsx';
import { Switch, Route} from 'react-router-dom';
import Login from './login/login.jsx';


function App() {
  return (
    <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Login} />
    </Switch>

  );
}

export default App;
